import React, { Component } from 'react';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import Axios from 'axios';
import { isPropertySignature } from 'typescript';

class PayRate extends Component {
  constructor(props) {
    super(props);
    this.state = {
      columns: [{ "header": "Rate", "name": "rate" },
      { "header": "Start Date", "name": "startDate" },
      { "header": "End Date", "name": "endDate" }],
      showAdd: false,
      showUpdate: false,
      showDelete: false,
      startDate: null,
      endDate: null,
      uniqueId: this.props.id
    }
    this.handleOnChange = this.handleOnChange.bind(this);
    this.handleAdd    = this.handleAdd.bind(this);
    this.handleUpdate = this.handleUpdate.bind(this);
    this.handleDelete = this.handleDelete.bind(this);
    this.handleClose = this.handleClose.bind(this);
    this.handleSubmitAdd = this.handleSubmitAdd.bind(this);
    this.handleSubmitUpdate = this.handleSubmitUpdate.bind(this);
    this.handleSubmitDelete = this.handleSubmitDelete.bind(this);
  }

  handleSubmitAdd(event) {
    debugger
    event.preventDefault();
    console.log("Form Add submitted");
    debugger
    let userData = {
        uniqueId: this.state.uniqueId,
      rate: this.state.rate,
      startDate: this.state.startDate,
      endDate: this.state.endDate
    }
    debugger
    Axios({
      url: 'http://localhost:9091/pay_rate/',
      method: "post",
      data: userData,
      headers: {
        'Content-Type': 'application/json'
      }

    }).then(res => {
      debugger
      console.log(this.props);
    }).catch(err => {
      console.log(err);
    })
    console.log(this.state.startDate);

    this.setState({
      id: null,
      rate: null,
      startDate: null,
      endDate: null,
      showAdd: false,
      showDelete: false,
      showUpdate: false,
      showBR: false
    })
  }

  handleSubmitUpdate(event) {
    event.preventDefault();
    console.log("Form Update submitted");
    if (this.state.rate) {
      let userData = {
        id: this.state.id,
        uniqueId: this.state.uniqueId,
        rate: this.state.rate,
        startDate: this.state.startDate,
        endDate: this.state.endDate
      }
      Axios({
        url: 'http://localhost:9091/pay_rate/' + this.state.id,
        method: "put",
        data: userData,
        headers: {
          'Content-Type': 'application/json'
        }

      }).then(res => {
        console.log(this.props);
      }).catch(err => {
        console.log(err);
      })
    }
    this.setState({
      id: null,
      rate: null,
      startDate: null,
      endDate: null,
      showAdd: false,
      showDelete: false,
      showUpdate: false,
    })
  }

  handleSubmitDelete(event) {
    event.preventDefault();
    console.log("Form Delete submitted");
    debugger
    if (this.state.id) {
      Axios({
        url: 'http://localhost:9091/pay_rate/' + this.state.id,
        method: "delete",
        data: "",
        headers: {
          'Content-Type': 'application/json'
        }

      }).then(res => {
        event.preventDefault();
        debugger
        console.log(this.props);
      }).catch(err => {
        console.log(err);
      })
    }
    this.setState({
      id: null,
      rate: null,
      startDate: null,
      endDate: null,
      showAdd: false,
      showDelete: false,
      showUpdate: false,
    })
  }

  handleAdd(event) {
    this.setState({
      showAdd: true,
      showDelete: false,
      showUpdate: false,
      show: false
    })
  }

  handleUpdate = (index) => {
    debugger;
    var id = this.props.rows[index].id;
    console.log(id);
    var startDate = this.props.rows[index].startDate;
    console.log(startDate);
    var endDate = this.props.rows[index].endDate;
    this.setState({
      id: id,
      rate: this.props.rows[index].rate,
      startDate: startDate,
      endDate: endDate,
      showUpdate: true,
      showAdd: false,
      showDelete: false
    })
  }

  handleDelete = (id) => {
    debugger
    this.setState({
        id: id,
      showDelete: true,
      showAdd: false,
      showUpdate: false,
    })
  }

  handleClose(event) {
    this.setState({
      showUpdate: false,
      showDelete: false,
      showAdd: false,
      showBR: false

    })
  }

  handleOnChange = (event) => {
    debugger
    console.log("line 88", event.target.value);
    let obj = {}

    obj[event.target.id] = event.target.value;

    this.setState({

      ...this.state.id,

      ...this.state.rate,

      ...this.state.startDate,

      ...this.state.endDate,

      ...obj


    })

    console.log("onchange =? obj => ", obj)
    console.log('this.state => ', this.state)

  }



  render() {
    console.log("props--------", this.props);
    console.log("line 314", this.state);
    return (
      <div>
        <table>
          <thead>
            <tr>
              {this.state.columns.map(col =>
                <th key={col.name}>{col.header}</th>
              )}
            </tr>
          </thead>
          <tbody>
            {this.props.rows.map((row, index) =>
              <tr key={row.id} >
                {this.state.columns.map(col =>
                  <td key={col.name}>{row[col.name]}</td>
                )}
                <Button variant="primary" onClick={() => { this.handleUpdate(index) }} > update </Button>
                <Button variant="primary" onClick={() => { this.handleDelete(row.id) }} > delete </Button>
              </tr>
            )}
          </tbody>
        </table>
        <Button variant="inherit" onClick={this.handleAdd}> Add</Button>

        <Modal show={this.state.showUpdate} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Update Pay Rate</Modal.Title>
          </Modal.Header>
          <form onSubmit={this.handleSubmitUpdate}>
            <Modal.Body>
              <br />
              <label For="id">ID</label>
              <br />
              <label For="id" >{this.state.id}</label>
              <br />
              <label For="rate">Rate</label>
              <input id="rate" name="rate" type="text" onChange={this.handleOnChange} value={this.state.rate} />
              <label for="startDate">Start Date</label>
              <input type="date" id="startDate" onChange={this.handleOnChange} value={this.state.startDate} />
              <label For="endDate">End Date</label>
              <input type="date" id="endDate" onChange={this.handleOnChange} value={this.state.endDate} />
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                Close
                </Button>
              <Button type="submit" variant="primary" >
                Submit
                </Button>
            </Modal.Footer>
          </form>
        </Modal>


        <Modal show={this.state.showDelete} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Are you sure you want to Delete?</Modal.Title>
          </Modal.Header>
          <form onSubmit={this.handleSubmitDelete}>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                No
                </Button>
              <Button type="submit" variant="primary">
                Yes
                </Button>
            </Modal.Footer>
          </form>
        </Modal>

       <Modal show={this.state.showAdd} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Add New Pay Rate</Modal.Title>
          </Modal.Header>
          <form onSubmit={this.handleSubmitAdd}>
            <Modal.Body>
              <label For="rate">Rate</label>
              <input id="rate" name="rate" type="text" onChange={this.handleOnChange} value={this.state.rate} />
              <label for="startDate">Start Date</label>
              <input type="date" id="startDate" class="form-control" onChange={this.handleOnChange} value={this.state.startDate} />
              <label For="endDate">End Date</label>
              <input type="date" id="endDate" class="form-control" onChange={this.handleOnChange} value={this.state.endDate} />
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                Close
                </Button>
              <Button type="submit" variant="primary" >
                Submit
                </Button>
            </Modal.Footer>
          </form> 
        </Modal>

      </div>
    );
  }
}

export default PayRate;
